window.bookSummaryJSON = "<p>Randy Wayne White is a journalist, veteran fishing guide, and author of several nonfiction collections. He also creates superb, best-selling suspense fiction. His novels have received the highest praise from <i>Library Journal</i> and <i>Booklist</i>, and from authors like Carl Hiassen, who says, \"Randy Wayne White takes us places that no other Florida mystery writer could hope to find.\"</p> <p> Marine biologist Doc Ford is spending two easy weeks on luxurious Guava Key compiling data. But when two young women at the resort are attacked, Doc comes to their rescue. In an instant, he is pulled into an international plan of revenge that becomes more deadly with each passing hour. Now, Doc isn’t counting fish--he’s adding up his chances for survival. <i>Shark River</i>’s eye-popping chases, eccentric characters, and taut suspense are all seasoned with a rich, dark humor that heightens the irony of Doc’s predicament. From its astonishing first sentence to the final punchline, this book is sure to grab every listener in its powerful grip.</p>"; 
